import React, { useEffect, useState } from "react"
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"

import Splash from "/home/ubuntu/dev/src/pages/splash/Splash.js"
import Access from "/home/ubuntu/dev/src/pages/access/js/Access.js"
import Frontpage from "/home/ubuntu/dev/src/pages/frontpage/js/Frontpage.js"

import Authentication from "/home/ubuntu/dev/src/js/Authentication.js"
import Unauthentication from "/home/ubuntu/dev/src/js/Unauthentication.js"

export default function CustomRoutes() {

  const [authenticated, setAuthenticated] = useState( false )
  useEffect( () => {
    authenticated && console.log( "User authenticated" )
  }, [authenticated] )

  return (
    <Router>
      <Switch>
        <Route exact path="/">
          {
            authenticated ?
              <Frontpage /> :
              <Splash />
          }
        </Route>

        <Route path="/frontpage" >
          {
            authenticated ?
              <Frontpage /> :
              <Splash />
          }
        </Route>

        <Route path="/access" >
          {
            authenticated ?
              <Frontpage /> :
              <Access
                status={authenticated}
                setStatus={() => { setAuthenticated() }}
              />
          }
        </Route>
      </Switch>
    </Router>
  )
}
